@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

atm:Transaction a owl:Class .
atm:BankComputer a owl:Class .
atm:ATM a owl:Class .

atm:receivesRequest a owl:ObjectProperty ;
  rdfs:domain atm:BankComputer ;
  rdfs:range atm:Transaction .

atm:processTransaction a owl:ObjectProperty ;
  rdfs:domain atm:BankComputer ;
  rdfs:range atm:Transaction .

atm:fromATM a owl:ObjectProperty ;
  rdfs:domain atm:Transaction ;
  rdfs:range atm:ATM .
